import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import PracSer from './PracSer';

function Prac() {
  let navigate = useNavigate();

  const [emp, setEmp] = useState({
    currentMarketValue: "",
    carpetArea: "",
    pincode: "",
    buildingAge: "",
    propertyEffect: "",
    security24x7: "",
    isSalaried: ""
  });

  const cancelHandler = (e) => {
    navigate("/home");
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEmp({ ...emp, [name]: value });
  };

  const saveHandler = (e) => {
    e.preventDefault();
    console.log("emp =>", emp);
    PracSer.createEmp(emp)
      .then(res => {
        navigate("/");
      })
      .catch(error => {
        console.error("Error saving user property details:", error);
      });
  };

  return (
    <div className='container mt-3'>
      <div className='row'>
        <div className='card col-md-6 oddset-md-3'>
          <h3 className='text-center'>Input</h3>
          <div className='card-body'>
            <form>
              <div className='form-group'>
                <label>Current Market Value</label>
                <input
                  type='text'
                  name='currentMarketValue'
                  className='form-control'
                  placeholder='Current Market Value'
                  value={emp.currentMarketValue}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Carpet Area</label>
                <input
                  type='text'
                  name='carpetArea'
                  className='form-control'
                  placeholder='Carpet Area'
                  value={emp.carpetArea}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Building Age</label>
                <input
                  type='text'
                  name='buildingAge'
                  className='form-control'
                  placeholder='Building Age'
                  value={emp.buildingAge}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Pincode</label>
                <input
                  type='text'
                  name='pincode'
                  className='form-control'
                  placeholder='Pincode'
                  value={emp.pincode}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Property Effect</label>
                <input
                  type='text'
                  name='propertyEffect'
                  className='form-control'
                  placeholder='Property Effect'
                  value={emp.propertyEffect}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Security 24x7</label>
                <input
                  type='text'
                  name='security24x7'
                  className='form-control'
                  placeholder='Security 24x7'
                  value={emp.security24x7}
                  onChange={handleChange}
                />
              </div>

              <div className='form-group'>
                <label>Is Salaried</label>
                <input
                  type='text'
                  name='isSalaried'
                  className='form-control'
                  placeholder='Is Salaried'
                  value={emp.isSalaried}
                  onChange={handleChange}
                />
              </div>

              <button className='btn btn-success' onClick={saveHandler}>Save</button>
              <button className='btn btn-danger' onClick={cancelHandler}>Cancel</button>

            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Prac;
